Roundandbrown - gizelle - Slide right in


Fri September 10, 2010
Giselle came to pay us a visit and boy are we glad she came. This girl is one of the definitions of Round and Brown! She has one of the biggest and nicest asses Ive seen in some time. We had to let her strut her stuff around the pool before we got started, so we set up a slip and slide in the lawn and turned the hose on an had some fun outside first. Before you knew it Jmac was banging her doggie style in the kiddie pool and she was loving it. From there we took it inside and wrapped things up with a nice load all over the Round and Brown booty. Enjoy!
